import React from 'react';



const Header =()=>{
return(
    <>
    <div className="row">
        <div className="header">
            <ul>
                <li><a>Home</a></li>
                <li><a>Home</a></li>
                <li><a>Home</a></li>
                <li><a>Home</a></li>
                <li><a>Home</a></li>
                <li><a>Home</a></li>
            </ul>
        </div>
    </div>
    
    </>
    );
};
export default Header;
